import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import styled from "styled-components";
import { Avatar } from "@material-ui/core";
import { Container, Text, CaptionText, SubText } from "../../styledComponents";
import hasLogo from "../../../public/static/HAS.png";

const useStyles = makeStyles(theme => ({
  small: {
    width: theme.spacing(10),
    height: theme.spacing(10),
    borderRadius: 0,
    backgroundColor: "transparent",
    border: 0
  }
}));
const HeaderSection = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  padding: 30px 110px;
  background-color: white;
`;
const ContentSection = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
`;
const SingleHouse = () => {
  const classes = useStyles();
  return (
    <Container flex={1}>
      <HeaderSection>
        <Container flex={false} color="transparent">
          <Avatar src={hasLogo} className={classes.small} />
        </Container>
        <Container flex={1} column customStyles={{ paddingLeft: 40 }}>
          <Text customStyle>Arby's</Text>
          <SubText>1155 Perimeter Center W, Atlanta, GA 30338, USA</SubText>
        </Container>
      </HeaderSection>
      <ContentSection></ContentSection>
    </Container>
  );
};

export default SingleHouse;
